import logo from "./logo.svg";
import "./App.css";
<link rel="stylesheet" href="https://cdnjs.cloudflare.com/ajax/libs/font-awesome/6.4.2/css/all.min.css"></link>
function App() {
  return <div className="bg-white">
    <div className="h-28 flex items-center">
      <img className="h-28 mt-6 p-1 rounded-r-lg flex items-stretch" src="https://cdn.pixabay.com/photo/2019/03/22/11/03/dressmaker-4073022_1280.jpg" alt="logo_yarn"></img>
      {/* <img className="h-28 mt-6 p-1 rounded-r-lg flex items-stretch" src="../images/logo.jpg" alt="logo_yarn"></img> */}
    </div>
  </div>;
}
<script src="https://cdn.jsdelivr.net/npm/swiper@10/swiper-bundle.min.js"></script>
export default App;
